INSERT INTO `feedback_info` VALUES (19, '2020-12-01 11:10:37', 451927125721747456, 'helen19930101@126.com', '期刊类别划分不清晰', '1.公卫与预防医学部分缺劳环卫内容；\n2.个人认为生物信息学可以与统计/计算类放在一起，区别于生物学，生物学习惯为分子生物学方向；\n3.期刊介绍信息不全或未显示（频繁报错），点进去频繁报错无详细信息，可参考medsci或letpub，比较希望直观看到近3-5年IF、主编信息、投稿链接、推荐阅读10篇这几个内容，其他可二次点击进入查看；\n4.使用感觉服务器不稳定，手机热点使用时频繁出现“timeout of 500ms exceedeed”报错；\n5.目前纳入期刊似乎只考虑高分杂志或关键词非常明显的杂志，一些小期刊也应该考虑，实际使用中文数据库的群体因为现实问题更倾向于采纳低分杂志（投稿、阅读），那么高分杂志为方便这部分人群使用，就应该提供高分杂志中推荐阅读10篇的中文摘要。', '', '2020-12-01 11:10:37', 0);
